description_sujet:
L’objectif du stage est de construire une base de données répondant aux besoins de l’équipe et permettant d’exporter ces données vers des bases plus importantes telles que GnpIS. Un travail préliminaire a été accompli sur l’analyse des données existantes et l’évolution envisagée dans les types de données (nouveaux outils de phénotypage, nouveaux capteurs, nouvelles techniques générant des fichiers originaux). Le  stagiaire devra dans un premier temps rédiger le cahier des charges pour la création de la base de données.  Il proposera le modèle conceptuel des données, et implémentera la base de données à l’aide du système de gestion de base de données PostgreSQL. Il devra également faire des propositions et concevoir l’interface web qui permettra la saisie, la consultation et l’exportation des données. Le stagiaire travaillera en étroite collaboration avec les ingénieurs INRA et Supagro de l’équipe AFEF en charge de la gestion des données ainsi qu’avec les informaticiens en charge des SGBD sur le CIRAD et l’INRA. Il sera en contact avec l’ensemble de l’équipe des permanents AFEF pour l’analyse et la satisfaction des besoins de la base de données. A l’issue du stage, une base de données, l’interface de saisie et l’interface de consultation seront opérationnelles. Un premier jet de l’interface de sortie vers la base de données Ephesis serait souhaitable pour deux types de données : la phénologie et données de structure-fonction. 
Activités dominantes confiées au stagiaire
- rédiger le cahier des charges de la base de données ; 
- concevoir et proposer le modèle conceptuel de la base de données;
- générer la BDD sous PostgreSQL des données hiérarchisées (et si possible géo-localisées) ;
- veiller à la compatibilité des données avec les BD majeures de la discipline (vocabulaire, ontologie) ; 
- proposer et concevoir l’interface WEB pour l’importation, la saisie, la consultation et l’exportation des données à destination de l’équipe AFEF et vers des bases de données nationales

Depuis 2009, nous éditons le site MyAbandonware.com, une des adresses majeures du retrogaming à travers le monde. Avec son âge d’adolescent, le site a mobilisé des milliers d’heures de travail, mais la liste des évolutions n’en finit plus de s’allonger. Certains items de la liste prennent la poussière depuis 10 ans, c’est pourquoi nous avons besoin de Nicolas pour s'y attaquer.

En objectif premier, MyAbandonware a besoin d’une newsletter hebdomadaire. Épaulé de son maître de stage, Nicolas aura pour mission de :

• qualifier la base email actuelle, comprenant 30 000 entrées, via des solutions à coder et des solutions payantes en API (étude a mener par Nicolas) ;
• étudier les solutions d’emailing existantes (automatisation via API) ;
• coder et intégrer la newsletter hebdomadaire (contenu automatisé à coder) ;
• permettre l’inscription à la newsletter sur le site.

Si sa progression le permet, nous lui proposerons d’autres fonctionnalités à coder, orientées front ou back-end. Un choix pourra être proposé pour correspondre à ses affinités.

En base technologique, il utilisera PHP 7.4, MySQL (MariaDB 10.5), Apache et Linux + MacOS. De par son âge, le site utilise des bibliothèques à la fois anciennes et très récentes, Nicolas devra s'attendre à déchiffrer le code des anciens tout en utilisant Composer. Il travaillera avec l’IDE PHPStorm, et Git en solution de versioning.
